import React, {useState, useEffect} from "react";
import walmartData from "./../../walmartData.json" 

import FirstBlockComponent from "./FirstBlockComponent";
import SecondBlockComponent from "./SecondBlockComponent";
import ThirdBlockComponent from "./ThirdBlockComponent";

function makeNewData (data, x, y) {
    console.log("moje dane");
    console.log(data)
    console.log(x)
    console.log(y)
    return 
}

function MainComponent() {
    //Stan bazy
    const [data,setData] = useState([]);
    const [newData, setNewData] = useState([]); 

    //Stan przyciskow 1 blok
    const [firstBlockButton, setFirstBlockButton] = useState();

    //Stan przyciskow 2 blok
    const [secondBlockButton, setSecondBlockButton] = useState();

    useEffect(() => {
        setData(walmartData);
        makeNewData(data, firstBlockButton, secondBlockButton);
    }, [])

    const handleClick = (e) => {
        setFirstBlockButton(e)
      }

    const handleClickSecondBlock = (e) => {
        setSecondBlockButton(e)
        if (firstBlockButton > 0) {
            console.log("rozne")
            makeNewData(data, firstBlockButton, secondBlockButton);
        }
    }

    return (
        <>
        <div>
            <h1>Nagłówek h1</h1>
        </div>

        <div>
            <div>
                <FirstBlockComponent handleClick={handleClick}/>
            </div>
            <div>
                <SecondBlockComponent handleClickSecondBlock={handleClickSecondBlock}/>
            </div>
            <div>
                <ThirdBlockComponent/>
            </div> 


        </div>
        </>
    )
}

export default MainComponent
